import React, {Component} from 'react';

export default class CreatePlayer extends Component{
   constructor(props) {
       super(props);

       this.state={
           player_name:'',
           player_position:'',
           player_notes:'',
           player_rating:'',
           player_completed:false
       }
   }

   onChangePlayerName = (e) =>
   this.setState({
       player_name:e.target.value
   })

   onChangePlayerPosition = (e) =>
   this.setState({
       player_position:e.target.value
   })

   onChangePlayerNotes = (e) =>
   this.setState({
       player_notes:e.target.value
   })

   onSubmit = (e) => {
    e.preventDefault(); 

    console.log(`player submitted:`);
    console.log(`player name: ${this.player_name}`)
    console.log(`player position: ${this.player_position}`)
    console.log(`player notes: ${this.player_notes}`)

    this.setState({
            player_name:'',
            player_position:'',
           player_notes:'',
           player_completed:false
    })
   }


    render() {
       return(
           <div style={{marginTop: 10}}>
               <h3>Create New Player</h3>

               <form onSubmit={this.onSubmit}>
               <div className='form-group'>
               <label>Player Name:</label>
               <input type='text' 
                      className='form-control'
                      value={this.state.player_name}
                      onChange={this.onChangePlayerName}
                      />
               </div>

               <div className='form-group'>
               <label>Player Position:</label>
               <input type='text' 
                      className='form-control'
                      value={this.state.player_position}
                      onChange={this.onChangePlayerPosition}
                      />
               </div>

               <div className='form-group'>
               <label>Player Notes:</label>
               <input type='text' 
                      className='form-control'
                      value={this.state.player_notes}
                      onChange={this.onChangePlayerNotes}
                      />
               </div>



               <div className ='form-group'>
                <div className='form-check form-check-inline'>
                    <input className='form-check-input'
                            type='radio'
                            name='priorityOptions'
                            id='priorityLow'
                            value='Low'
                            checked={this.state.todo_priority === 'Low'}
                            onChange={this.onChangeTodoPriority}/>
                      <label className='form-check-label'>Low</label>      
                </div>

                <div className='form-check form-check-inline'>
                    <input className='form-check-input'
                            type='radio'
                            name='priorityOptions'
                            id='priorityMedium'
                            value='Medium'
                            checked={this.state.todo_priority === 'Medium'}
                            onChange={this.onChangeTodoPriority}/>
                      <label className='form-check-label'>Medium</label>      
                </div>

                <div className='form-check form-check-inline'>
                    <input className='form-check-input'
                            type='radio'
                            name='priorityOptions'
                            id='priorityHigh'
                            value='High'
                            checked={this.state.todo_priority === 'High'}
                            onChange={this.onChangeTodoPriority}/>
                      <label className='form-check-label'>High</label>      
                </div>
               </div>
               <div className='form-group'>
               <input type='submit' value='Create Player File' className='btn btn-primary'/>
                   </div>
               </form>
               </div>
       )
   }

}
